import styled from 'styled-components';

export const ReviewWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 400px;
  justify-content: center;
  align-items: center;
`;

export const ReviewBlock = styled.div`
  display: flex;
  width: 300px;
  height: 80px;
  box-shadow: 6px 6px 12px rgba(0, 0, 0, 0.16);
`;
